import React from 'react'

export default function PageNotFound() {
  return (
    // <div>PageNotFound</div>
    <div className="min-h-screen flex flex-col justify-center items-center">
      <h1 className="text-6xl font-bold text-gray-800 mb-8">404</h1>
      <p className="text-2xl text-gray-600 mb-8">Oops! The page you are looking for does not exist.</p>
      <Link to="/" className="px-4 py-2 bg-gray-800 text-white rounded-full hover:bg-gray-900 transition-colors duration-300">Go back home</Link>
    </div>
  )
}
